    def IsChong(self, s):
        long = len(s)
        if long >96:
            return False
        i = 1
        for c in s:
            if (s[i: long]).__contains__(c):
                return False
            i = i+1
        return True

    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        long =len(s)
        i = long-1

        if i==-1:
            return 0

        while i >= 1:
            j = 0

            while j + i < long:
                if self.IsChong(s[j : j+i+1]) ==True:
                    return i+1
                j = j + 1
            i=i-1
        else:
            return 1


